import Flight from '../models/Flight';

const interpolate = (p1, p2, steps) => {
  const points = [];
  for (let i = 0; i <= steps; i++) {
    points.push({
      latitude: p1.latitude + (p2.latitude - p1.latitude) * (i / steps),
      longitude: p1.longitude + (p2.longitude - p1.longitude) * (i / steps),
    });
  }
  return points;
};

const expandPath = coords => {
  let full = [];
  for (let i = 0; i < coords.length - 1; i++) {
    const seg = interpolate(coords[i], coords[i + 1], 12); // 12 points per segment
    full = [...full, ...seg];
  }
  return full;
};

